import{_ as l,o as i,c as a,U as e}from"./chunks/framework.489e5108.js";const g=JSON.parse('{"title":"MISC 入门指南","description":"","frontmatter":{},"headers":[],"relativePath":"6.计算机安全/6.4安全杂项.md","filePath":"6.计算机安全/6.4安全杂项.md","lastUpdated":1696176798000}'),u={name:"6.计算机安全/6.4安全杂项.md"},t=e('<h1 id="misc-入门指南" tabindex="-1">MISC 入门指南 <a class="header-anchor" href="#misc-入门指南" aria-label="Permalink to &quot;MISC 入门指南&quot;">​</a></h1><blockquote><p>本文来自 HGAME Mini 2022 Misc 入门材料</p></blockquote><h2 id="misc-简单介绍" tabindex="-1">MISC 简单介绍 <a class="header-anchor" href="#misc-简单介绍" aria-label="Permalink to &quot;MISC 简单介绍&quot;">​</a></h2><p>Misc 是 Miscellaneous 的缩写，杂项、混合体、大杂烩的意思，它是一个庞大而又有趣的分支，几乎会涉及所有分类的基础，包括内容安全、安全运维、网络编程、AI 安全等不属于传统分类的知识，作为发散思维、拓展自己的一个知识面而言也是挺不错的方向。</p><p><strong>MISC 大概有这些方面内容</strong>：</p><ul><li>信息收集</li><li>编码转换</li><li>隐写分析</li><li>数字取证</li><li>......</li></ul><p><img src="https://ctf-wiki.org/misc/figure/all.png" alt="img"></p><h2 id="简单分块介绍" tabindex="-1">简单分块介绍 <a class="header-anchor" href="#简单分块介绍" aria-label="Permalink to &quot;简单分块介绍&quot;">​</a></h2><h3 id="信息收集" tabindex="-1">信息收集 <a class="header-anchor" href="#信息收集" aria-label="Permalink to &quot;信息收集&quot;">​</a></h3><h4 id="基本搜集技巧" tabindex="-1">基本搜集技巧 <a class="header-anchor" href="#基本搜集技巧" aria-label="Permalink to &quot;基本搜集技巧&quot;">​</a></h4><p>简单一句话：多问搜索引擎，搜就完事了！</p><ul><li>目标 Web 网页、地理位置、相关组织</li><li>Google 基本搜索与挖掘技巧（Google hacking）</li><li>网站、域名、IP：whois 等</li><li>通过搜索引擎查找特定安全漏洞或私密信息</li><li>组织结构和人员、个人资料、电话、电子邮件</li><li>企业等实体：YellowPage、企业信用信息网</li><li>国内：百度地图、卫星地图、街景</li></ul><h3 id="编码转换" tabindex="-1">编码转换 <a class="header-anchor" href="#编码转换" aria-label="Permalink to &quot;编码转换&quot;">​</a></h3><ul><li><p>各种古典密码</p><ul><li>摩斯电码</li><li>凯撒密码</li><li>栅栏密码</li><li>ROT13</li><li>维吉尼亚密码</li></ul></li><li><p>计算机常用编码</p><ul><li>Ascii</li><li>Unicode</li><li>HTML 实体编码</li></ul></li><li><p>其他编码</p><ul><li>二维码</li><li>条形码</li><li>Js 加密 / Jother/JSFuck</li><li>URL 编码</li><li>Hex 编码</li><li>Base 大家族</li><li>MD5、SHA1 等类似加密型</li><li>与佛论禅</li><li>兽音译者</li><li>...</li></ul></li></ul><h3 id="隐写" tabindex="-1">隐写 <a class="header-anchor" href="#隐写" aria-label="Permalink to &quot;隐写&quot;">​</a></h3><ul><li><p>图片隐写</p><ul><li>jpg 隐写 <ul><li>Steghide</li><li>Stegdetect</li><li>Slienteye</li><li>Jhps</li></ul></li><li>png 隐写 <ul><li>Stepsolve</li><li>Stepic</li></ul></li><li>gif 隐写 <ul><li>时间</li><li>空间</li></ul></li><li>bmp 隐写 <ul><li>LSB</li></ul></li></ul></li><li><p>音频隐写</p><ul><li>频谱</li><li>波形</li><li>LSB</li><li>Tools <ul><li><p>Wav</p><ul><li>Steganography</li><li>steghide</li></ul></li><li><p>Mp3</p><ul><li>Mp3stego</li></ul></li></ul></li></ul></li><li><p>视频隐写</p><ul><li>MSU Stego</li><li>TCStego</li></ul></li><li><p>文档隐写</p><ul><li>Word</li><li>PDF</li></ul></li><li><p>流量包</p><ul><li>协议</li><li>传输</li></ul></li><li><p>交换数据流</p><ul><li>NTFS</li></ul></li><li><p>Vmdk</p><ul><li>dsfok-tools</li></ul></li></ul><h3 id="取证" tabindex="-1">取证 <a class="header-anchor" href="#取证" aria-label="Permalink to &quot;取证&quot;">​</a></h3><ul><li>图片取证 <ul><li>Jpg <ul><li>stegdetect</li></ul></li><li>Png <ul><li>Pngcheck</li><li>Tweakpng</li></ul></li></ul></li><li>音频取证 <ul><li>Audacity</li></ul></li><li>视频取证 <ul><li>FFmpeg</li></ul></li><li>流量包取证 <ul><li>Wireshark</li><li>Tshark</li><li>Pacpfix</li></ul></li><li>内存取证 <ul><li>Vol</li></ul></li><li>磁盘文件取证 <ul><li>Ftx</li></ul></li><li>文档取证 <ul><li>Pdf <ul><li>Pdf-parser</li><li>Pdf-crack</li></ul></li><li>Word</li></ul></li><li>压缩包 <ul><li>Zip <ul><li>Fcrackzip</li><li>Apchpr</li><li>Pkcrack</li></ul></li><li>Rar <ul><li>Rarcrack</li></ul></li></ul></li><li>固件分析 <ul><li>binwalk</li><li>sleuthkit</li></ul></li></ul><p><code>VIDAR{Misc_1s_e4sy_t0_st4rt!!}</code></p>',19),o=[t];function r(s,c,p,h,n,d){return i(),a("div",null,o)}const k=l(u,[["render",r]]);export{g as __pageData,k as default};
